106	119	article	14a8bd6f-8525-4363-977f-c2990fa24340	{"slug":"how-to-start","title":"Как начать проект: пошаговый гайд","summary":"В этой статье мы пройдём путь от идеи до минимально жизнеспособного продукта. Материал подходит для небольших продуктовых команд и фриланс-проектов.","cover":"328f9ecc-48d1-44f3-acbc-0480f5b3ccb9","content":"<h2>Подготовка</h2>\\n<p>Перед тем как писать код &mdash; поговорите с реальными пользователями и соберите бриф.</p>\\n<p>Популярность ведения бизнеса именно таким способом возрастает, как и объём недовольств и претензий потребителей, хотя способ реализации товаров, услуг и работ именно дистанционным способом, был всегда подконтролен Роспотребнадзору.</p>\\n<ul>\\n<li>Интервью с пользователями</li>\\n<li>Анализ конкурентов</li>\\n<li>Определение целей проекта</li>\\n</ul>\\n<p>Популярность ведения бизнеса именно таким способом возрастает, как и объём недовольств и претензий потребителей, хотя способ реализации товаров, услуг и работ именно дистанционным способом, был всегда подконтролен Роспотребнадзору.</p>\\n<p><img src=\\"http://localhost:8055/assets/27f1811e-d5f2-44c4-adaf-d3c31258a0b2.jpg?width=1280&amp;height=840\\" alt=\\"Cover\\"></p>\\n<h2>Реализация</h2>\\n<p>Разбейте работу на фазы: MVP &rarr; итерации &rarr; улучшения. В каждой фазе чёткие критерии готовности.</p>\\n<p><img src=\\"http://localhost:8055/assets/41eea89d-92fd-4c62-952e-24686efb5741.jpg?width=1280&amp;height=840\\" alt=\\"Cover\\"></p>\\n<p>Введение деловой энергии открывает уникальный мир, в котором внешние проявления и успех компании неразрывно связаны с её внутренней энергией. Как и эзотерические учения, бизнес имеет свою собственную тонкую структуру, которую можно воспринимать и преобразовывать. В этом разделе мы рассмотрим важность понимания отношений между внутренним и внешним миром бизнеса.</p>\\n<p><strong>10 млн</strong> - Минимальный набор фич для валидации гипотезы;</p>\\n<p><strong>2 года </strong>- Быстрые итерации по собранной обратной связи;</p>"}	{"slug":"how-to-start","title":"Как начать проект: пошаговый гайд","summary":"В этой статье мы пройдём путь от идеи до минимально жизнеспособного продукта. Материал подходит для небольших продуктовых команд и фриланс-проектов.","cover":"328f9ecc-48d1-44f3-acbc-0480f5b3ccb9","content":"<h2>Подготовка</h2>\\n<p>Перед тем как писать код &mdash; поговорите с реальными пользователями и соберите бриф.</p>\\n<p>Популярность ведения бизнеса именно таким способом возрастает, как и объём недовольств и претензий потребителей, хотя способ реализации товаров, услуг и работ именно дистанционным способом, был всегда подконтролен Роспотребнадзору.</p>\\n<ul>\\n<li>Интервью с пользователями</li>\\n<li>Анализ конкурентов</li>\\n<li>Определение целей проекта</li>\\n</ul>\\n<p>Популярность ведения бизнеса именно таким способом возрастает, как и объём недовольств и претензий потребителей, хотя способ реализации товаров, услуг и работ именно дистанционным способом, был всегда подконтролен Роспотребнадзору.</p>\\n<p><img src=\\"http://localhost:8055/assets/27f1811e-d5f2-44c4-adaf-d3c31258a0b2.jpg?width=1280&amp;height=840\\" alt=\\"Cover\\"></p>\\n<h2>Реализация</h2>\\n<p>Разбейте работу на фазы: MVP &rarr; итерации &rarr; улучшения. В каждой фазе чёткие критерии готовности.</p>\\n<p><img src=\\"http://localhost:8055/assets/41eea89d-92fd-4c62-952e-24686efb5741.jpg?width=1280&amp;height=840\\" alt=\\"Cover\\"></p>\\n<p>Введение деловой энергии открывает уникальный мир, в котором внешние проявления и успех компании неразрывно связаны с её внутренней энергией. Как и эзотерические учения, бизнес имеет свою собственную тонкую структуру, которую можно воспринимать и преобразовывать. В этом разделе мы рассмотрим важность понимания отношений между внутренним и внешним миром бизнеса.</p>\\n<p><strong>10 млн</strong> - Минимальный набор фич для валидации гипотезы;</p>\\n<p><strong>2 года </strong>- Быстрые итерации по собранной обратной связи;</p>"}	\N	\N
